import { 
    Row,
    Form,
    Col,
    Image
} from 'react-bootstrap';
import PropTypes from 'prop-types';

function GaleriaImagens(props) {

    const URL_IMG = 'http://localhost/restful/img/';

    function visivelImagens() {
        console.log(props.imagens);
        return props.visivel ? 'mt-3' : 'hidden';
    }

    return ( 
        props.imagens.map(img => {
            <Col 
                md={3}>
                <Image 
                    src={URL_IMG + img.image}
                    thumbnail />
                    teste 2
            </Col>
        })
    );
}

GaleriaImagens.propTypes = {
    imagens: PropTypes.array.isRequired
}

export default GaleriaImagens;
